    return(<>
            <Card className="text-center">
            <Card.Header>{ historial}</Card.Header>
            <Card.Body>
                <Card.Text>
                {pagina}
                ip:192.162.0.1
                </Card.Text>
                <Button variant="primary">ver Pagina</Button>
            </Card.Body>
            </Card>   
    </>)

}
export default  Carta
